import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for a "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });

    // Click the first "Your Profile" link (simulate navigation to profile)
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length === 0) throw new Error('No "Your Profile" link found');
    await profileLinks[0].click();

    // Wait for profile section to load (look for profile image by alt attribute)
    await page.waitForSelector('img[alt="Jun Kim"]', { timeout: 5000 });

    // Take screenshot of profile section
    const profileShot = path.join(screenshotsDir, 'step_2_profile.png');
    await page.screenshot({ path: profileShot });
    screenshots.push(profileShot);

    // Extract Jun's profile info using different selectors
    // Full name: .profile-info h2
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    // Username: .username
    const username = await page.$eval('.username', el => el.textContent.trim());
    // Bio: .bio
    const bio = await page.$eval('.bio', el => el.textContent.trim());
    // Orders: .profile-stats .stat:nth-child(1) .stat-number
    const orders = await page.$eval('.profile-stats .stat:nth-child(1) .stat-number', el => el.textContent.trim());
    // Reviews: .profile-stats .stat:nth-child(2) .stat-number
    const reviews = await page.$eval('.profile-stats .stat:nth-child(2) .stat-number', el => el.textContent.trim());
    // Seller Rating: .profile-stats .stat:nth-child(3) .stat-number
    const sellerRating = await page.$eval('.profile-stats .stat:nth-child(3) .stat-number', el => el.textContent.trim());
    // Profile image src
    const profileImage = await page.$eval('img[alt="Jun Kim"]', el => el.getAttribute('src'));

    // Take screenshot of the profile stats section
    const statsSection = await page.$('.profile-stats');
    if (statsSection) {
      const statsShot = path.join(screenshotsDir, 'step_3_profile_stats.png');
      await statsSection.screenshot({ path: statsShot });
      screenshots.push(statsShot);
    }

    // Extract Jun's recent reviews (grab first review title and content)
    const firstReviewTitle = await page.$eval('.reviews-list .review-title', el => el.textContent.trim());
    const firstReviewContent = await page.$eval('.reviews-list .review-content', el => el.textContent.trim());

    // Take screenshot of the reviews section
    const reviewsSection = await page.$('.reviews-list');
    if (reviewsSection) {
      const reviewsShot = path.join(screenshotsDir, 'step_4_reviews.png');
      await reviewsSection.screenshot({ path: reviewsShot });
      screenshots.push(reviewsShot);
    }

    // Extract Jun's products (grab titles of all products by Jun)
    const junProductTitles = await page.$$eval('.profile-sections .section:nth-child(1) .product-title', els =>
      els.map(el => el.textContent.trim())
    );

    // Take screenshot of Jun's products section
    const junProductsSection = await page.$('.profile-sections .section:nth-child(1)');
    if (junProductsSection) {
      const junProductsShot = path.join(screenshotsDir, 'step_5_jun_products.png');
      await junProductsSection.screenshot({ path: junProductsShot });
      screenshots.push(junProductsShot);
    }

    return {
      success: true,
      action: "Harvested Jun's user profile information including name, username, bio, stats, profile image, recent review, and Jun's products.",
      extractedData: {
        fullName,
        username,
        bio,
        orders,
        reviews,
        sellerRating,
        profileImage,
        firstReview: {
          title: firstReviewTitle,
          content: firstReviewContent
        },
        junProductTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
